import { withRouter } from 'next/router';
import Layout from '../components/Layout';
import LandingPortfolio from '../components/LandingPortfolio';

const Post = withRouter(props => (
  <Layout>
    <LandingPortfolio />
    <h1>{props.router.query.title}</h1>
    <h1>{props.summary}</h1>
  </Layout>
));

export default Post;
